                    <Formations />
                </Route>
                <Route path="/personalinfo">
                    <PersonalInfo />
                </Route>
                <Route path="/signup">
                    <SignUp />
                </Route>
                <Route path="/">
                    <Home />
                </Route>
            </Switch>
        </div>
    );
}

export default App;
